  "certSystemIntroCont1": (()=>{const fn=(ctx) => {const { normalize: _normalize } = ctx;return _normalize(["NFTonShow certification is open for all MetaID users to apply. It requires KYC and verifies that the user names will not infringe the copyright or cause confusion. Special attention will also be paid to the copyright issue of the work by the certified creators."])};fn.source="NFTonShow certification is open for all MetaID users to apply. It requires KYC and verifies that the user names will not infringe the copyright or cause confusion. Special attention will also be paid to the copyright issue of the work by the certified creators.";return fn;})(),
  "certSystemIntroCont2": (()=>{const fn=(ctx) => {const { normalize: _normalize } = ctx;return _normalize(["wPay, as the commercial operator of NFTonShow, does to minimize the infringement issue of the market content. It is a platform-based certification, not a MetaID-based certification. Moreover, this certification is more for artistic and physical NFTs, and most of the future functional NFTs do not require certification. This certification does not represent ShowPay's recognition of the value of the account or the work, and the users must bear the investment risk by themselves."])};fn.source="wPay, as the commercial operator of NFTonShow, does to minimize the infringement issue of the market content. It is a platform-based certification, not a MetaID-based certification. Moreover, this certification is more for artistic and physical NFTs, and most of the future functional NFTs do not require certification. This certification does not represent ShowPay's recognition of the value of the account or the work, and the users must bear the investment risk by themselves.";return fn;})(),
