  "certSystemIntroCont1": (()=>{const fn=(ctx) => {const { normalize: _normalize } = ctx;return _normalize(["NOS認定ユーザーは、個人アカウント、機関アカウント、および企業アカウント情報の信頼性を公式に確認、認証済みのユーザーです。ユーザーのアカウントが認証された後、ユーザーのアカウントは対応するIDを持ち、認証情報はブロックチェーンに記録され、個人情報及びプライバシーに影響を与えることなく可能な限り開示されます。"])};fn.source="NOS認定ユーザーは、個人アカウント、機関アカウント、および企業アカウント情報の信頼性を公式に確認、認証済みのユーザーです。ユーザーのアカウントが認証された後、ユーザーのアカウントは対応するIDを持ち、認証情報はブロックチェーンに記録され、個人情報及びプライバシーに影響を与えることなく可能な限り開示されます。";return fn;})(),
  "certSystemIntroCont2": (()=>{const fn=(ctx) => {const { normalize: _normalize } = ctx;return _normalize(["NOS認定は、すべてのMetaIDユーザーが申請可能です。NOS認定には、ユーザーのMetaIDとKYCなどユーザー情報の一致性を確認することが必要です。認証されたユーザーの作品における著作権の問題にも特別な注意が払われます。"])};fn.source="NOS認定は、すべてのMetaIDユーザーが申請可能です。NOS認定には、ユーザーのMetaIDとKYCなどユーザー情報の一致性を確認することが必要です。認証されたユーザーの作品における著作権の問題にも特別な注意が払われます。";return fn;})(),
